import React from 'react';
import { BrowserRouter as Router, Route, Switch, Redirect } from 'react-router-dom';
import Register from './components/Register'; // Ensure the path is correct
import Login from './components/Login'; // Ensure the path is correct
import Dashboard from './components/Dashboard';
import ProductManagement from './components/ProductManagement';
import AddProduct from './components/AddProduct';

function App() {
  return (
    <Router>
      <Switch>
        <Route exact path="/">
          <Redirect to="/login" />
        </Route>
        <Route path="/dashboard" component={Dashboard} />
        <Route path="/product" component={ProductManagement} />
        <Route path="/[p]" component={AddProduct} />
        <Route path="/login" component={Login} />
        <Route path="/register" component={Register} />
        {/* Add other routes here */}
      </Switch>
    </Router>
  );
}

export default App;
